get_backend = Backend.get_backend

tutorial = Blueprint('tutorial', __name__)

def complete_url(url):
    for _key in dict(request.args).keys():
        if _key in ['uid', 'page']:
            continue
        _value = request.args.get(_key,default=None, type=None)
        if _value:
            url += '&{}={}'.format(_key, _value)
    return url

@tutorial.route('/_finish_tutorial/', methods=['GET'])
def finish_tutorial():
    backend = get_backend()
    backend.finish_tutorial(userid())
    return jsonify(success=True)

